  false,\n\t\"url\": null,\n\t\"notes\": \"This report summarizes a White-faced Ibis
  study that was conducted on Benton Lake NWR during 1997. The objectives were to
  locate and monitor a sample of nests and document their success and habitat parameters.
  This report summarizes the methods, results, and recommendations for future studies.
  Field data sheets, maps, photographs, a diagram of the egg float test, and nest
  data sheets are attached.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
